import { useState, useEffect } from 'react';
import axios from "axios";


function Home({notes}) {

  return (
    <div>
      <h1> All Notes </h1>
      {notes.map((note) =>(
        <p key={note._id}>{note}</p>) )}
        
    </div>
  );
}

export default Home;
